import Profile from './Profiles';



class Stories extends Component {
    render() {
      return (
        <div className="stories">
            <div>
                <h3>Stories</h3>
            </div>
            <div>
                <h3>Watch All</h3>
            </div>
            <div>
                <Profile />
                <Profile />
                <Profile />
            </div>
        </div>
      )
    }
}


export default Stories;
